export default function Home() {
    return (

        <div className="mx-20 my-20">
        <h1 className="text-red-500 text-2xl">Professional Profile</h1>
        <p>Computer Science Graduate with a creative mindset and a passion for Software Development. Acquired solid foundation in object-oriented programming with Java. Progressed into developing and integrating REST APIs using object-oriented PHP. Collaborative team player attuned to working in a fast-paced environment whilst providing excellent quality service. Described as ‘outstanding, friendly and attentive’ by customers. Independent and adaptive problem solver with a keen eye for detail and strong work ethic. Proactive and committed learner with an optimistic attitude. Confident decision maker and resilient self starter. </p>
        </div>
    )
}
